import React from 'react'
import { ListContainer, Row, Text } from './styles'

function TodoList({todos}) {
  console.log(todos, 'hi')
  return (
    <div>
      <h1>AYAW</h1>
      <ListContainer>
        {todos?.map((todos) => {
          <Row key={todos._id}>
            <Text>{todos.text}</Text>
          </Row>
        })}
      </ListContainer>
    </div>
  )
}

export default TodoList
